import axios from "axios";
import { useEffect, useState } from "react"; //to use function to get information  and useState to store data
import { Table } from "react-bootstrap";

function DoctAss() {

    const [doctors, setdoctor] = useState([]);

    useEffect(() => {
        axios.get("http://localhost:4000/doctorAss", { withCredentials: true })
            .then(res => {
                setdoctor(res.data.drassigmnent.dr);
            }).catch(err => console.log(err));
    }, [])

    return (
        <Table striped bordered hover>
            <thead>
                <tr>
                    <th>#</th>
                    <th>First Name</th>
                    <th>Last Name</th>
                    <th>Username</th>
                </tr>
            </thead>
                {doctors.map((doctor) => (
                    <tbody>
                        <tr>
                            <th scope="row">1</th>
                            <td><a title="Go to Profile" style="text-decoration: none;" href="/doctor/profile/{{this._id}}">{ doctor.name }}</a></td>
                            <td>{doctor._id }</td>
                            <td>{doctor.email }</td>
                            <td>{doctor.datenow }</td>
                            <td><a href="/addlistdr/{{this._id}}" class="btn btn-danger">Delete <i class="fas fa-trash-alt"></i></a></td>
                        </tr>
                    </tbody>
                ))
                }
        </Table>
    )
}

export default DoctAss;
